   "aboutSection": "<p>Over 10+ years, Sanzaal ry has been a key connection point for the Nepalese in Finland. As a ​non-profit, we've created events that combine entertainment, culture, and community ​awareness for our members.</p><br><p>Today, the very same passionate team behind Sanzaal ry's memorable events is excited to ​introduce you to our next chapter: Yellow Bridge. Yellow Bridge is not just an event business ​company; it is our renewed promise to create transcendent experiences. Our legacy of ​bridging communities and cultures remains our guiding star, and under the banner of Yellow ​Bridge, we are committed to designing events that are not just occasions, but experiences; not ​just gatherings, but connections.</p><br><p>Join us, as we embark on this exciting journey with Yellow Bridge, crafting unparalleled event ​experiences with the same dedication, spirit, and heart that you’ve come to associate with ​Sanzaal ry.</p>",  
  
